const App = () => {
  return (
    <div>
      <MapContainer center={[44.119370, 15.231365]} zoom={13} scrollWheelZoom={true}>
      <TestDatabaze />

        //<Maps />
        <Markers />



      </MapContainer>
    </div>

  )
}

export default App;
